import React, { useState,useEffect } from 'react';
import './account-option-popover.css';

export default function AccountOptionPopover(){

    const options=["settings","Log in"]
    return(
        <div>

            {options.map((option)=> <div className="acc-option-popover"> {option} </div>)}
        </div>
    )
}
